#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define LEN 52

#define INDEX(i) ((i) > 96 ? (i) - 71 : (i) - 65)

#define MAX_INT 1000000000

int is_equal(int *s_map, int *t_map)
{
  for (int i = 0; i < LEN; i++)
  {
    if (t_map[i] > 0 && s_map[i] < t_map[i])
      return 0;
  }
  return 1;
}

void print(int *s_map, int *t_map)
{
  for (int i = 0; i < LEN; i++)
  {
    printf("%d\t%d\n", s_map[i], t_map[i]);
  }
}

char *minWindow(char *s, char *t)
{
  size_t l_s = strlen(s);
  size_t l_t = strlen(t);
  int t_map[LEN] = {0};
  int s_map[LEN] = {0};
  int *end_buf = (int *)malloc(l_s * sizeof(int));
  int min_b = 0, min_e = 0;

  if (l_s == 0 || l_t == 0 || l_t > l_s)
    return "";

  for (int i = 0; i < l_s; i++)
    end_buf[i] = MAX_INT;

  for (int i = 0; i < l_t; i++)
  {
    t_map[INDEX((int)t[i])]++;
  }

  for (min_e = 0; min_e < l_t; min_e++)
  {
    int b = INDEX((int)s[min_e]);
    s_map[b] += (int)(t_map[b] > 0);
  }
  for (min_e = l_t; min_e < l_s && is_equal(s_map, t_map) == 0; min_e++)
  {
    int ind = INDEX((int)s[min_e]);
    s_map[ind] += (int)(t_map[ind] > 0);
  }
  if (is_equal(s_map, t_map) == 0)
    return "";
  end_buf[0] = --min_e;

  for (int i = 1; i < l_s; i++)
  {
    int ind = INDEX((int)s[i - 1]);

    if (t_map[ind] == 0)
      end_buf[i] = end_buf[i - 1];
    else if (s_map[ind] > t_map[ind])
    {
      end_buf[i] = end_buf[i - 1];
      s_map[ind]--;
    }
    else
    {
      s_map[ind]--;
      for (int j = end_buf[i - 1] + 1; j < l_s; j++)
      {
        int ind_ = INDEX((int)s[j]);
        s_map[ind_] += (int)(t_map[ind_] > 0);
        if (s[j] == s[i - 1])
        {
          end_buf[i] = j;
          break;
        }
      }
    }

    if (end_buf[i] - i < min_e - min_b)
    {
      min_b = i;
      min_e = end_buf[i];
    }
  }

  int l = min_e - min_b + 1;
  char *res = (char *)malloc((l + 1) * sizeof(char));
  strncpy(res, s + min_b, l);
  res[l] = '\0';

  return res;
}

int main(int argc, char *argv[])
{
  char *s = "";
  char *t = "";

  printf("res: %s\n", minWindow(s, t));

  return 0;
}
